import React from 'react';
export default function FAQ(){
  return (
    <div>
      <h2>FAQ</h2>
      <h4>How long to deliver?</h4>
      <p>Delivery and service ETA is ~1 hour by default (demo).</p>
      <h4>Which fuels?</h4>
      <p>Petrol and Diesel in this demo; admin can add more in DB.</p>
    </div>
  );
}
